// Profile.js
import React from 'react';
import './Profile.css';

const Profile = () => {
  return (
    <div className="profile-container">
      <h1 className="main-heading">My Profile</h1>
      
      <h2 className="section-heading">Completed Tutorials</h2>
      <ul className="profile-list">
        <li>Getting Started</li>
        <li>Connecting with Family</li>
      </ul>
      
      <h2 className="section-heading">Saved Resources</h2>
      <p className="no-resources-message">You haven't saved any resources yet.</p>
    </div>
  );
};

export default Profile;
